async function processImage(imageUrl) {
  const urlPath = new URL(imageUrl).pathname;
  const imageName = urlPath.split("/").pop().split("?")[0];
  const baseName = path.basename(imageName, path.extname(imageName));
  const sanitizedImageName = baseName.replace(/[<>:"/\\|?*]/g, "_");

  const outputPath = path.join(imagesDir, `${sanitizedImageName}.png`);

  const response = await axios({
    url: imageUrl,
    responseType: "arraybuffer",
  });

  const imageBuffer = Buffer.from(response.data);
  const pngBuffer = await sharp(imageBuffer).toFormat("png").toBuffer();

  const image = await Jimp.read(pngBuffer);
  const bgColor = Jimp.cssColorToHex("#FFFFFF");

  image.scan(0, 0, image.bitmap.width, image.bitmap.height, (x, y, idx) => {
    const pixelColor = Jimp.rgbaToInt(
      image.bitmap.data[idx + 0],
      image.bitmap.data[idx + 1],
      image.bitmap.data[idx + 2],
      image.bitmap.data[idx + 3]
    );

    if (pixelColor === bgColor) {
      image.bitmap.data[idx + 3] = 0;
    }
  });

  await image.writeAsync(outputPath);
  return outputPath;
}

app.get("/removeBg", async (req, res) => {
  try {
    const updatedProducts = await Promise.all(
      products.map(async (product) => {
        if (product.thumbnail) {
          const newThumbnailPath = await processImage(product.thumbnail);
          const newThumbnailUrl = `http://localhost:3000/images/${path.basename(
            newThumbnailPath
          )}`;
          return { ...product, thumbnail: newThumbnailUrl };
        }
        return product;
      })
    );

    res.status(200).json(updatedProducts);
  } catch (error) {
    res.status(500).json({ error: error.message });
  }
});

// Serve the images statically
app.use("/images", express.static(imagesDir));

app.listen(3000, () => {
  console.log("Server is running on port 3000");
});
